import React from 'react';
import { Breadcrumb, BreadcrumbItem } from 'react-bootstrap';
import { useLocation } from 'react-router-dom';
import { HashLink } from 'react-router-hash-link';

const Breadcrumbs = () => {
    // Get the active page from the URL
    const location = useLocation();
    const path = location.pathname;

    return (
        <Breadcrumb id='breadcrumb-container'>
            <BreadcrumbItem className='crumb'>
                <HashLink to='#'><h3>Home</h3></HashLink>
            </BreadcrumbItem>
            <BreadcrumbItem active={path === '/#about' ? true : false}>
                <HashLink to='#about'><h3>About Me</h3></HashLink>
            </BreadcrumbItem>
            <BreadcrumbItem active={path === '/#portfolio' ? true : false}>
                <HashLink to='#portfolio'><h3>My Work</h3></HashLink>
            </BreadcrumbItem>
            <BreadcrumbItem active={path === '/#contact' ? true : false}>
                <HashLink to='#contact'><h3 >Contact</h3></HashLink>
            </BreadcrumbItem>
        </Breadcrumb>
    )
};

export default Breadcrumbs;
